const MOCK_DESC =
  "학년과 월을 선택해보세요\n" +
  "실제 모의고사와 동일한 구성의 문제들을 만날 수 있습니다";
const RANGE_DESC =
  "원하는 문제의 조건을 선택해 보세요\n" +
  "조건을 만족하는 문제들로 문제집을 구성합니다";
const TITLE_VALID = "공백이 아닌 20자 이하의 이름을 입력해주세요.";
const MULTI_SELECT_VALID = "한가지 이상 선택해주세요.";
const QUESTION_NUM_VALID = "1이상 100이하의 수를 입력해주세요.";
const CREATE_VALID = "입력값이 올바르지 않습니다.";
export {
  MOCK_DESC,
  RANGE_DESC,
  TITLE_VALID,
  MULTI_SELECT_VALID,
  QUESTION_NUM_VALID,
  CREATE_VALID,
};
